import React, { useState } from "react";

const AdminContent: React.FC = () => {
  const [isProfilePublic, setIsProfilePublic] = useState<boolean>(true);

  return (
    <div className="card p-4">
      <h2>Admin</h2>
      <p>Choisissez la visibilité de votre profil :</p>
      <div>
        <label>
          <input type="radio" name="visibility" checked={isProfilePublic} onChange={() => setIsProfilePublic(true)} />
          Public
        </label>
        <label className="ml-3">
          <input type="radio" name="visibility" checked={!isProfilePublic} onChange={() => setIsProfilePublic(false)} />
          Privé
        </label>
      </div>
      <p>Votre profil est actuellement <strong>{isProfilePublic ? "public" : "privé"}</strong>.</p>
    </div>
  );
};

export default AdminContent;
